details:
The mission of J.H. House Elementary School, a safe and nurturing environment where all students can achieve their highest academic and social potential, is to equip students with the knowledge, skills, and qualities required to meet the challenges of a constantly changing world through:
· High academic and behavioral expectations for all students;
· Focused and effective teaching and support services;
· The availability of academic and technological resources at school and home;
· Opportunities that promote actively involved families and communities.
